  MDBDropdownToggle, MDBDropdownMenu, MDBDropdownItem, MDBIcon
} from "mdbreact";
import HeaderNav from './pages/sections/HeaderNav';


class Header extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
    };
    this.onClick = this.onClick.bind(this);
    this.handleLogOut = this.handleLogOut.bind(this);
  }
  handleLogOut = () => {
    console.log(this.props.loggedIn);

    // console.log('ok');

  }

  onClick() {
    this.setState({
      collapse: !this.state.collapse,
    });
  }

  render() {
    return (
      <div>
        <header>
          <MDBNavbar color="default-color" dark expand="md" scrolling fixed="top">
            <MDBNavbarBrand>
              <strong className="white-text">Typo</strong>
            </MDBNavbarBrand>
            <MDBNavbarToggler onClick={this.onClick} />
            <MDBCollapse id="navbarCollapse3" isOpen={this.state.collapse} navbar>
              {this.props.loggedIn ? Navigation : null}
              <MDBNavbarNav right id='secondNav'>
                {/* <MDBNavItem>
                  <MDBNavLink className="waves-effect waves-light" to="#!">
                    <MDBIcon fab icon="twitter" />
                  </MDBNavLink>
                </MDBNavItem> */}
                {/* <MDBNavItem>
                  <MDBNavLink className="waves-effect waves-light" to="#!">
                    <MDBIcon fab icon="google-plus-g" />
                  </MDBNavLink>
                </MDBNavItem> */}
                <MDBNavItem id='profileBtn' style={{ display: '' }}>
                  <MDBDropdown>
                    <MDBDropdownToggle nav caret>
                      <MDBIcon icon="user" className="mr-1" />
                    </MDBDropdownToggle>
                    <MDBDropdownMenu className="dropdown-default" right>
                      <MDBNavLink style={{ color: '#008066' }} onClick={this.handleLogOut} to="/login">
                        LogOut
                      </MDBNavLink>
                      {/* <MDBDropdownItem href="#!">Another Action</MDBDropdownItem> */}
                      {/* <MDBDropdownItem href="#!">Something else here</MDBDropdownItem> */}
                      {/* <MDBDropdownItem href="#!">Something else here</MDBDropdownItem> */}
                    </MDBDropdownMenu>
                  </MDBDropdown>
                </MDBNavItem>
              </MDBNavbarNav>
            </MDBCollapse>
          </MDBNavbar>
        </header>
      </div>
    );
  }
}

export default Header
